import React, {useEffect, useState} from 'react';
import axios from 'axios'

const styles = {
  position: 'absolute',
  backgroundColor: 'red',
  top: '200px',
  right: '200px',
}

export default function Created() {
  const [createdRecipes, setCreatedRecipes] = useState([]);
  useEffect(() => {
    (async function () {
      const response = await axios(`http://localhost:3001/recipes/created`)
      setCreatedRecipes(response)
    })()
  }, [])
  return (
    <div> 
      <ul style={ styles }> 
        { createdRecipes.map((createdRecipe) =>{
          return <li> {createdRecipe.title} </li>
        }) }
      </ul>

    </div>
  )
}
